import { Component } from '@angular/core';

@Component({
  selector: 'app-carrito',
  template: '<div class="container"><h1>Carrito de Compras - Componente en construcción</h1></div>',
  styles: ['.container { padding: 40px 20px; }']
})
export class CarritoComponent {}
